class GNB():
    def __init__(self):
        self.summary = {}  # İncludes class means and standart deviations


    def class_summary(self,train_x,train_y):
        summary = {}
        classes = np.unique(train_y)


        for i in classes:
            label_i = train_x[train_y == i]

            # Extracting mean and standart deviation of each class
            mean = np.mean(label_i,axis=0)
            std = np.std(label_i,axis=0)

            summary[i] = (mean,std)

        return summary

    def fit(self,train_x,train_y):
        self.summary = self.class_summary(train_x,train_y)


    # Calculation of Gaussian Density
    def gaussian_Density(self,x,mean,std):
        expo = np.exp(-((x-mean) ** 2)/(2 * std ** 2))

        return (1/(np.sqrt(2*np.pi)*std)) * expo

    # Calculating class probabilities for each class for given test data.
    def calculate_Probabilities(self,summary,row):
        probs = {}

        for i,(mean,std) in summary.items():
            probs[i] = 1

            for j in range(len(row)):
                x = row[j]
                mean_x = mean[j]
                std_x = std[j]

                probs[i] *= self.gaussian_Density(x,mean_x,std_x)

        return probs


    def predict(self,x_Test):


        predictions = []
        summary = self.summary
        for row in x_Test:

            probs = self.calculate_Probabilities(summary,row)
            pred = max(probs,key = probs.get) # Choosing the class assigned to highest probability
            predictions.append(pred)


        return np.array(predictions)

