def confusion_matrix(y_true,pred):
    classes = [i for i in range(10)]

    matrix = np.zeros((10,10))  # Initially empty confusion matrix
    for i in classes:
        index = (y_true == i) # getting index of i'th class labels from ground truth

        pred_c = pred[index] # Taking labels from the index calculated above

        for j in classes:
            count = np.sum(pred_c == j) # Counting how many examples at that index

            matrix[i][j] = count


    return matrix

def calculate_model_accuracy(conf_matrix):

    return np.sum(np.diagonal(conf_matrix)) / np.sum(conf_matrix) # (True Positive) / (All Examples)

def calculate_accuracy(conf_matrix):
    acc = np.diagonal(conf_matrix) / np.sum(conf_matrix,axis=1) # (Diagonal Array) / (Each row) ---> gives that class' accuracy
    acc = np.nan_to_num(acc,nan=-1) # Converting nan values to -1 if there any class which is not included in test data.

    return acc

